--
-- Helpers
--
function set4bpp() poke4(2 * 0x3ffc, 2) end

function set2bpp() poke4(2 * 0x3ffc, 4) end

function sget(x,y)
	local addr=0x4000+(x//8+y//8*16)*32
	return peek4(addr*2+x%8+y%8*8)
end

function sset(x,y,c)
	local addr=0x4000+(x//8+y//8*16)*32
	poke4(addr*2+x%8+y%8*8,c)
end

function pset(p)
	for i=0, 11 do
		poke(0x3FC0+i,p[i+1],8)
	end
end

function mxy_sxy(x,y)
	local mx=(x-(map_draw_x-2))*8
	local my=(y-(map_draw_y-2))*8
	local sx=mx+map_offset_x
	local sy=my+map_offset_y
	return {sx,sy}
end

function recolorTile(sx,sy,p)
	for x=sx, sx+7 do
		for y=sy, sy+7 do
			local pixC = pix(x,y)
			if pixC < 4 then
				pix(x,y,p[pixC+1])
			end
		end
	end
end

function map_to_sheet(t) return t+((t//16)*16) end

function collectTile(idx)
	local grid={}
	for x=0, 255 do
		grid[x]={}
		for y=0, 255 do
			grid[x][y]=sget(x,y)
		end
	end
	tildat[idx]=grid
end

function collectSpr(idx)
	local grid={}
	for x=256, 511 do
		grid[x]={}
		for y=256, 511 do
			grid[x][y]=sget(x,y)
		end
	end
	sprdat[idx]=grid
end

function collectMap(idx)
	local grid={}
	for x=0, 239 do
		grid[x]={}
		for y=0, 135 do
			grid[x][y]=mget(x,y)
		end
	end
	mapdat[idx]=grid
end

function collectData(idx)
	--if idx <= 2 then collectSpr(idx) end
	collectTile(idx)
	collectSpr(idx)
	collectMap(idx)
end

function collect()
	if bankdata_step > 0 and not bankdata_loaded then
		sync(0,bankdata_step-1,false)
		trace("SYNCED TO BANK: "..bankdata_step-1)
		collectData(bankdata_step)
		bankdata_step = bankdata_step - 1
		if bankdata_step <= 0 then bankdata_loaded = true end
	end
end

function tableContains(t, v)
	found = false
	for _, x in pairs(t) do
		if x == v then
			found = true
		end
	end
	return found
end

function tableLength(t)
	local count = 0
	for _ in pairs(t) do count = count + 1 end
	return count
end

function round(num, dec)
	local mult = 10^(dec or 0)
	return math.floor(num * mult + 0.5) / mult
end

function roundHalf(num)
	local pos = num > 0
	local r = num
	local base = math.floor(num)
	if pos then 
		r = r - base 
	else 
	 base = math.ceil(num)
		r = math.abs(r - base)
	end
	if r < 0.5 then
		if r <= 0.25 then r = 0 else r = 0.5 end
	else
		if r <= 0.75 then r = 0.5 else r = 1.0 end
	end
	if not pos then r = r * -1.0 end
	return r + base
end

function clamp(n, l, h) return math.min(math.max(n,l),h) end

function map_wrap_x(tx)
	if tx >= 240 then return tx - 240
	elseif tx < 0 then return tx + 240
	else return tx end
end

function map_wrap_y(ty)
	if ty >= 136 then return ty - 136
	elseif ty < 0 then return ty + 136
	else return ty end
end
--
-- Game
--
function make_character(name, x, y)
	if anim_glossary[name] ~= nil then
		return Char.new({name,anim_glossary[name],x,y})
	else
		return false
	end
end

function stop_character(char)
	char.p = true
	char.fi = 1
end

function validate_movement(char, tx, ty)
	local result = true
	if (tx < 238 and tx > 1) and (ty < 134 and ty > 1) then
		for xrange=tx, tx+1 do
			for yrange=ty, ty+1 do
				local ctile = mapdat[3][xrange][yrange]
				if tableContains(cflags, ctile) then result = false end
			end
		end
	else
		local wrapx = {}
		local wrapy = {}
		if tx == -2 then wrapx = {238,239} end
		if tx == -1 then wrapx = {239,0} end
		if tx == 241 then wrapx = {1,0} end
		if tx == 240 then wrapx = {0,239} end
		if ty == -2 then wrapy = {134,135} end
		if ty == -1 then wrapy = {135,0} end
		if ty == 137 then wrapy = {1,0} end
		if ty == 135 then wrapy = {0,135} end
		for i,x in ipairs(wrapx) do
			for ii,y in ipairs(wrapy) do
				local ctile = mapdat[3][x][y]
				if tableContains(cflags, ctile) then result = false end
			end
		end
	end

	return result
end

function make_movement(char, dir)
	if char.act == false then
		fx = char.wx
		fy = char.wy
		if dir == "up" then fy=fy-2 end
		if dir == "down" then fy=fy+2 end
		if dir == "left" then fx=fx-2 end
		if dir == "right" then fx=fx+2 end
		fx = map_wrap_x(fx)
		fy = map_wrap_y(fy)
		trace("Making Movement To Target "..fx.. " : "..fy)
		if validate_movement(char, fx, fy) then
			trace("VALID MOVEMENT")
			char.act = true
			return Movement.new({char, 0.2, dir, fx, fy})
		end
	else return false end
end

