	trace("BOOT")
	set2bpp()
	player = make_character("player", 14, 8)
	table.insert(characters, make_character("sarah", 16, 8))
	trace(mget(25,5))
	local a = tostring(6)..","..tostring(5)
	local b = "6,5"
	trace(a == b)
	for i=0,47 do
		map_to_sheet(i)
	end

end

function proc_Input()
	if btnp(0) then
		inputs.up.held = true
		inputs.up.time = 0
	end
	if btn(0) then inputs.up.time = inputs.up.time + 1 else inputs.up.held = false end
	if btnp(1) then
		inputs.down.held = true
		inputs.down.time = 0
	end
	if btn(1) then inputs.down.time = inputs.down.time + 1 else inputs.down.held = false end
	if btnp(2) then
		inputs.left.held = true
		inputs.left.time = 0
	end
	if btn(2) then inputs.left.time = inputs.left.time + 1 else inputs.left.held = false end
	if btnp(3) then
		inputs.right.held = true
		inputs.right.time = 0
	end
	if btn(3) then inputs.right.time = inputs.right.time + 1 else inputs.right.held = false end
end

function query_WorldMovement(input_dir, anim, dir)
	if input_dir.held then
		if input_dir.time < 2 then
			player.a = anim
			player.ft = 0
			stop_character(player)
		else player.p = false end
		if input_dir.time > 6 then
			local new_movement = make_movement(player, dir)
			if new_movement ~= false then table.insert(actions, new_movement) end
		end
	elseif input_dir.time >= 2 then
		stop_character(player)
		input_dir.time = 0
	end
end

function build_Acts()
	if game_state == "world" then
		query_WorldMovement(inputs.up, player.fs.walk_u, "up")
		query_WorldMovement(inputs.down, player.fs.walk_d, "down")
		query_WorldMovement(inputs.left, player.fs.walk_l, "left")
		query_WorldMovement(inputs.right, player.fs.walk_r, "right")
	end
end

function proc_Acts()
	for k,v in pairs(actions) do
		finished = false
		if v.act_type == "movement" then
			if round(v.c.wx,1) == round(v.fx,1) and round(v.c.wy,1) == round(v.fy,1) then
				finished = true
				v.c.act = false
				if v.c.n == "player" then
					map_draw_x = player.wx - 14
					map_draw_y = player.wy - 8
					map_offset_x = -16
					map_offset_y = -16
				end
			end
			if finished == false then
				pre_x = v.c.wx
				pre_y = v.c.wy
				if v.d == "up" then v.c.wy=v.c.wy-v.s end
				if v.d == "down" then v.c.wy=v.c.wy+v.s end
				if v.d == "left" then v.c.wx=v.c.wx-v.s end
				if v.d == "right" then v.c.wx=v.c.wx+v.s end
				v.c.wx = round(v.c.wx, 1)
				v.c.wy = round(v.c.wy, 1)
				v.c.wx = map_wrap_x(v.c.wx)
				v.c.wy = map_wrap_y(v.c.wy)
				if v.c.n == "player" and map_pan_smooth then
					map_offset_x = map_offset_x + ((pre_x - v.c.wx) * 8)
					map_offset_y = map_offset_y + ((pre_y - v.c.wy) * 8)
				end
			end
		end
		if finished then
			v = nil
			table.remove(actions, k)
		end
	end
end

function tile_Overrides(tile,x,y)
	local cdat=3
	local pdat=5
	if current_bank == 2 then
		cdat=4
		pdat=6
	end
	local ctile = mapdat[cdat][x][y]
	local ptile = mapdat[pdat][x][y]
	if ptile ~= 0 then
		local sxy=mxy_sxy(x,y)
		if (sxy[1]>=0 and sxy[1]<=240)
		and (sxy[2]>=0 and sxy[2]<=136) then
			table.insert(
				ptileQueue,
				{sxy[1],sxy[2],ptile}
			)
		end
	end
	if ctile == 16 then
		table.insert(postDrawQueue, {tile,x,y})
	else
		return tile
	end
end

function draw_Map()
	local mx = map_draw_x-2
	local my = map_draw_y-2
	map(mx,my,34,21,map_offset_x,map_offset_y,-1,1,tile_Overrides)
	print(tableLength(ptileQueue),4,24)
	if current_bank == 1 and bankdata_loaded then
		for i,v in ipairs(ptileQueue) do
			recolorTile(v[1],v[2],palcodes[v[3]])
		end
	end
end

function proc_Map()
	origin_x = round(player.wx - 14, 1)
	origin_y = round(player.wy - 8, 1)
	if not map_pan_smooth then
		origin_x = roundHalf(origin_x)
		origin_y = roundHalf(origin_y)
		map_draw_x = origin_x
		map_draw_y = origin_y
	end
	ptileQueue={}
	postDrawQueue={}
	draw_Map()	
end

function proc_Anims()
	if player.p == false then
		if player.ft > 12 then
			player.ft = 0
			player.fi = player.fi + 1
			if player.fi > tableLength(player.a) then player.fi = 1 end
		end
		player.ft = player.ft + 1
	end
	for k,v in pairs(characters) do
		if v.p == false then
			if v.ft > 12 then
				v.ft = 0
				v.fi = v.fi + 1
				if v.fi > tableLength(v.a) then v.fi = 1 end
			end
			v.ft = v.ft + 1
		end
	end
end

function proc_Spr()
	spr(player.a[player.fi],112,64,0,1,0,0,2,2)
	for k,v in pairs(characters) do
		local sxy=mxy_sxy(v.wx,v.wy)
		spr(v.a[v.fi],sxy[1],sxy[2],0,1,0,0,2,2)
	end
end

function proc_PostDrawMap()
	local ydiff = 34
	for i,v in ipairs(postDrawQueue) do
		print(v[1].." : "..(v[2]-origin_x)*8 .."|"..(v[3]-origin_y)*8,4,ydiff,7)
		local sxy=mxy_sxy(v[2],v[3])
		spr(map_to_sheet(v[1]),sxy[1],sxy[2],0,1)
		ydiff = ydiff + 8
	end
end

function TIC()
	cls()
	if not bankdata_loaded then collect() end
	proc_Input()
	build_Acts()
	proc_Acts()
	proc_Map()
	proc_Anims()
	proc_Spr()
	if tableLength(postDrawQueue) > 0 then proc_PostDrawMap() end
	print("PX: "..player.wx.." PY: "..player.wy, 4,4,9)
	if not bankdata_loaded then cls() end
	if t > 12 then t = 0 end
	t = t + 1
end


